import React from 'react'

export default function BetAnimal() {
    return (
        <div className="mt-3">
            <img src="./img/AnimalBetGameImage/bau.png" style={{ width: '100%' }} alt="" />

            <div className="bg-success mt-2 pb-2 text-center" style={{ borderRadius: '10px' }}>
                <button className="btn btn-danger mr-3"><i className="fa fa-plus">+</i></button>
                <span className="mt-2" style={{ color:'yellow', fontSize:25 }}>100</span>
                <button className="btn btn-danger ml-3">-</button>
            </div>
        </div>
    )
}
